import React from "react";
import img from '../../../Assets/Images/Logo/face.png';


const whyChooseUs = (props) => (
    <div>
        <div>
            <h3>{props.title}</h3>
            <p>{props.para}</p>
        </div>
        <div>
            <img src={img} />
        </div>
    </div>
)

export default whyChooseUs;
